-- ----------------------------
-- Table structure for `character`
-- ----------------------------
DROP TABLE IF EXISTS `character`;
CREATE TABLE `character` (
  `char_index` bigint(20) unsigned NOT NULL COMMENT '唯一ID',
  `account_index` bigint(20) unsigned NOT NULL COMMENT '所属账号',
  `char_name` varchar(16) NOT NULL,
  `char_type` tinyint(1) unsigned NOT NULL DEFAULT '255',
  `spid` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '渠道id',
  `ws_id` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '大区id',
  `ss_id` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '逻辑服id',
  `fs_id` smallint(6) NOT NULL DEFAULT '0' COMMENT '所在fs服，可做断线重连标记',
  `pos_x` int(11) NOT NULL DEFAULT '0',
  `pos_y` int(11) NOT NULL DEFAULT '0',
  `scene_type_idx` int(11) unsigned NOT NULL DEFAULT '0',
  `scene_obj_idx` bigint(20) unsigned NOT NULL DEFAULT '0',
  `flags` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '特殊标记',
  `model_idx` int(11) unsigned NOT NULL DEFAULT '0',
  `job` tinyint(1) unsigned NOT NULL DEFAULT '0',
  `level` smallint(6) unsigned NOT NULL DEFAULT '1',
  `exp` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '经验',
  `energy` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '能量',
  `gold` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '金币',
  `coin` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '银币',
  `hp` int(11) unsigned NOT NULL DEFAULT '0',
  `hp_max` int(11) unsigned NOT NULL DEFAULT '0',
  `hurt` int(11) unsigned NOT NULL DEFAULT '0',
  `range` int(11) unsigned NOT NULL DEFAULT '0',
  `run_speed` int(11) unsigned NOT NULL DEFAULT '0',
  `vip_grade` int(11) unsigned NOT NULL DEFAULT '0',
  `vip_flags` int(11) unsigned NOT NULL DEFAULT '0',
  `last_daily_reset_time` bigint(20) unsigned NOT NULL DEFAULT '0',
  `time_created` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
  `last_update_time` datetime NOT NULL DEFAULT '1970-01-01 00:00:00',
  `time_last_login` bigint(20) NOT NULL DEFAULT '0' COMMENT '最后登入时间，秒',
  `time_last_logout` bigint(20) NOT NULL DEFAULT '0' COMMENT '最后登出时间，秒',
  `deleted` tinyint(1) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`char_index`),
  UNIQUE KEY `account_index` (`account_index`),
  KEY `charname_index` (`char_name`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

