DROP PROCEDURE IF EXISTS `SP_CHARACTER_BASE`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_CHARACTER_BASE`(IN p_char_idx BIGINT UNSIGNED)
BEGIN
	select	`char_index`, 
					`account_index`,  
					`spid`,   
					`char_name`,
          `char_type`,  
					`ws_id`,        
					`ss_id`,        
					`fs_id`,          
          `pos_x`,
					`pos_y`,
					`scene_type_idx`,
					`scene_obj_idx`,
					`flags`,
					`model_idx`,
					`job`,
					`level`,
					`exp`,
          `energy`, 
					`gold`,
					`coin`,
					`hp`,
					`hp_max`,
					`hurt`,
					`range`,
					`run_speed`,
					`vip_grade`,
					`vip_flags`,
					`time_last_login`,
					`time_last_logout`
    from `character` where char_index = p_char_idx and deleted = 0; 
                        
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `SP_CHARACTER_CREATE`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_CHARACTER_CREATE`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_CHARACTER_CREATE`(IN i_char_limit SMALLINT UNSIGNED,
        IN i_char_id BIGINT,     IN i_account_id BIGINT, IN i_spid SMALLINT UNSIGNED ,
        IN i_charname VARCHAR(16) charset utf8,
        IN i_char_type INTEGER UNSIGNED,   IN i_wid SMALLINT UNSIGNED, IN i_sid SMALLINT UNSIGNED, IN i_fid SMALLINT UNSIGNED)
BEGIN
return_label:begin
		declare char_count tinyint unsigned default 0;
    declare init_born_scene_id int unsigned default 0;
    declare init_born_pos_x int default 0;
    declare init_born_pos_y int default 0;
    declare init_addition_attack_param smallint unsigned default 0;
    declare init_hp int unsigned default 0;
    declare has_charbase int default 0;
		declare insert_character_id bigint unsigned default 0;
    declare exit handler for SQLSTATE '23000' begin rollback;select 0;end;
    
    select count(*) from `character` where account_index = i_account_id and deleted = 0 into char_count;
    if (char_count >= i_char_limit) then
    	select 1;
			leave return_label;
    end if;
    
    if exists(select 1 from `character` where `character`.char_name = i_charname) then
    	select 2;
      leave return_label;
    end if;    

    start transaction;
    
			set init_born_pos_x = FLOOR( -30 + RAND() * (30 + 30));
			set init_born_pos_y = FLOOR( -30 + RAND() * (30 + 30));
			set init_born_scene_id = 1000;  
  
    	insert into `character`(char_index,account_index,spid,char_name,char_type,ws_id,ss_id,fs_id,pos_x,pos_y,scene_type_idx,scene_obj_idx,job,time_created,last_update_time)
    	values(i_char_id,i_account_id,i_spid,i_charname,i_char_type,i_wid,i_sid,i_fid,init_born_pos_x,init_born_pos_y,init_born_scene_id,init_born_scene_id,0,now(),now());

			if row_count() = 1 then
    		set insert_character_id = i_char_id;
				#insert into `character_max_count`(`character_max_count`.w_id, `character_max_count`.count) values(w_id,1);

					#此处添加 额外表的数据插入语句
				select insert_character_id;
			else
    		select 3;
			end if;
    
    commit;
    
end return_label;
    
END
;;
DELIMITER ;

