-- ----------------------------
-- Procedure structure for `SP_DB_EVENT_CREATE`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_DB_EVENT_CREATE`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_DB_EVENT_CREATE`(IN i_event_idx bigint(20), IN i_target_idx bigint(20),
     IN i_source_idx bigint(20),
    IN i_event_cmd int(11) UNSIGNED,
      IN i_bin_content blob)
BEGIN
return_label:begin
		#防止相同事件插入
		if(exists(select 1 from `game_event` where target_char_idx = i_target_idx and source_char_idx = i_source_idx and event_cmd = i_event_cmd)) then
				leave return_label;
		end if;

		insert into `game_event`(event_idx, target_char_idx, source_char_idx, event_cmd, last_update_time, bin_content)
		values(i_event_idx, i_target_idx, i_source_idx, i_event_cmd, now(), i_bin_content);

end return_label;
END
;;
DELIMITER ;

