-- ----------------------------
-- Procedure structure for `SP_MAIL_LIST`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_MAIL_LIST`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_MAIL_LIST`(IN i_receiver BIGINT, IN i_spid SMALLINT UNSIGNED, IN i_time INT)
BEGIN
	select 
    mail_idx, 
    mail_type,
		spid,
		receiver_idx,
    sender_idx,
    sender_name,
    send_time,
    expire_time, 
    flags,
		`subject`,
		bin_mail_content
    from `mail_box` where (receiver_idx = i_receiver or receiver_idx = 0) and (spid = i_spid or spid = 0) and (send_time + expire_time >= i_time || expire_time = 0);
END
;;
DELIMITER ;

