-- ----------------------------
-- Procedure structure for `SP_SERVER_START_COUNT`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_SERVER_START_COUNT`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_SERVER_START_COUNT`()
BEGIN
	declare data_count int unsigned default 0;
    declare exit handler for SQLEXCEPTION begin rollback;select 0;end;     

    start transaction;
    select count(*) from `server_start_count` into data_count;
    if(data_count = 1) then    	
    	select start_count from `server_start_count` limit 1 for update; 
    	update `server_start_count` set start_count = start_count + 1;
    else
    	select 0;
    end if;
    commit;
END
;;
DELIMITER ;

